/*Table structure for table `bus_building_info` */

DROP TABLE IF EXISTS `bus_building_info`;

CREATE TABLE `bus_building_info` (
  `BBI_ID` varchar(40) NOT NULL COMMENT '主键',
  `BBI_COLLECT_ID` varchar(40) DEFAULT NULL COMMENT '临时表id',
  `BBI_BU_NAME` varchar(200) DEFAULT NULL COMMENT '楼宇名称',
  `BBI_STREET` varchar(40) DEFAULT NULL COMMENT '所属街乡',
  `BBI_BU_LEVEL` varchar(100) DEFAULT NULL COMMENT '楼宇等级',
  `BBI_BU_TYPE` varchar(100) DEFAULT NULL COMMENT '楼宇类型',
  `BBI_BU_USERTYPE` varchar(40) DEFAULT NULL COMMENT '(弃用)',
  `BBI_BU_DOMAIN` varchar(200) DEFAULT NULL COMMENT '楼宇分布区域',
  `BBI_ADDRESS` varchar(200) DEFAULT NULL COMMENT '楼宇地址',
  `BBI_BU_HEIGHT` varchar(200) DEFAULT NULL COMMENT '楼宇高度',
  `BBI_UP_FLOOR_NUM` int(11) DEFAULT NULL COMMENT '地上层数',
  `BBI_DOWN_FLOOR_NUM` int(11) DEFAULT NULL COMMENT '地下层数',
  `BBI_LAND_USAGE` varchar(100) DEFAULT NULL COMMENT '用地性质',
  `BBI_LAND_AREA` decimal(20,2) DEFAULT NULL COMMENT '用地面积',
  `BBI_STRUCT_AREA` decimal(20,2) DEFAULT NULL COMMENT '建筑面积',
  `BBI_UP_STRUCT_AREA` decimal(20,2) DEFAULT NULL COMMENT '地上建筑面积',
  `BBI_DOWN_STRUCT_AREA` decimal(20,2) DEFAULT NULL COMMENT '地下建筑面积',
  `BBI_USED_AREA` decimal(20,2) DEFAULT NULL COMMENT '使用面积',
  `BBI_UP_USED_AREA` decimal(20,2) DEFAULT NULL COMMENT '地上使用面积',
  `BBI_DOWN_USED_AREA` decimal(20,2) DEFAULT NULL COMMENT '地下使用面积',
  `BBI_PARK_NUM` int(11) DEFAULT NULL COMMENT '停车位个数',
  `BBI_UP_PARK_NUM` int(11) DEFAULT NULL COMMENT '地上停车位个数',
  `BBI_UP_PARK_PRICE` decimal(20,2) DEFAULT NULL COMMENT '地上停车位时租',
  `BBI_DOWN_PARK_NUM` int(11) DEFAULT NULL COMMENT '地下停车位个数',
  `BBI_DOWN_PARK_PRICE` decimal(20,2) DEFAULT NULL COMMENT '地下停车位时租',
  `BBI_FIXED_PARK_NUM` int(11) DEFAULT NULL COMMENT '固定停车位个数',
  `BBI_FIXED_PARK_PRICE` decimal(20,2) DEFAULT NULL COMMENT '固定停车位月租',
  `BBI_PARK_TYPE` varchar(200) DEFAULT NULL COMMENT '可选停车位类型',
  `BBI_AVG_MANAGE_FEE` decimal(20,2) DEFAULT NULL COMMENT '平均物管费',
  `BBI_AVG_RENT` decimal(20,2) DEFAULT NULL COMMENT '平均租金',
  `BBI_PIC_PATH` varchar(200) DEFAULT NULL COMMENT '楼宇图片地址',
  `BBI_COORD_BIGINTITUDE` decimal(20,8) DEFAULT NULL COMMENT '楼宇坐标(经度)',
  `BBI_COORD_LATITUDE` decimal(20,8) DEFAULT NULL COMMENT '楼宇坐标(纬度)',
  `BBI_DEVELOPER` varchar(200) DEFAULT NULL COMMENT '楼宇开发商',
  `BBI_DEV_CORP` varchar(200) DEFAULT NULL COMMENT '开发商法定代表人',
  `BBI_PROPERTY_UNIT` varchar(200) DEFAULT NULL COMMENT '楼宇产权单位',
  `BBI_PROUNIT_CORP` varchar(200) DEFAULT NULL COMMENT '产权单位法定代表人',
  `BBI_MG_COMPANY` varchar(200) DEFAULT NULL COMMENT '物业管理公司',
  `BBI_MGCMP_CORP` varchar(200) DEFAULT NULL COMMENT '物业公司法定代表人',
  `BBI_CONTACT` varchar(200) DEFAULT NULL COMMENT '联系人姓名',
  `BBI_TEL` varchar(200) DEFAULT NULL COMMENT '联系人电话',
  `BBI_AVG_PARK_PRICE` decimal(20,2) DEFAULT '0.00' COMMENT '平均停车位时租',
  `BBI_RENT_AREA` decimal(20,2) DEFAULT '0.00' COMMENT '楼宇出租面积',
  `BBI_VACANT_AREA` decimal(20,2) DEFAULT '0.00' COMMENT '楼宇空置面积',
  `BBI_TOTAL_WATER` decimal(20,2) DEFAULT '0.00' COMMENT '楼宇今年总水能耗',
  `BBI_TOTAL_ELECTRIC` decimal(20,2) DEFAULT '0.00' COMMENT '楼宇今年总电能耗',
  `BBI_TOTAL_THERMAL` decimal(20,2) DEFAULT '0.00' COMMENT '楼宇今年总热能耗',
  `BBI_POINT_TAG` varchar(100) DEFAULT NULL COMMENT '两万平米以上楼宇标志  1 两万平米以上重点楼宇 0 两万平米以下重点楼宇',
  `BBI_TOTAL_ROOM_NUM` bigint(20) DEFAULT NULL COMMENT '房间总数',
  `BBI_ENTER_ROOM_NUM` bigint(20) DEFAULT NULL COMMENT '入驻企业房间个数',
  `BBI_VACANCY_ROOM_NUM` bigint(20) DEFAULT NULL COMMENT '空置房间个数',
  `BBI_DECORATE_ROOM_NUM` bigint(20) DEFAULT NULL COMMENT '装修房间个数',
  `BBI_COMPANY_NUM` bigint(20) DEFAULT NULL COMMENT '楼宇入驻企业数',
  `BBI_DELETE_TAG` varchar(11) DEFAULT '01' COMMENT '删除标志     01：正常;  02：已删除',
  `BBI_ENERGY_TAG` varchar(255) DEFAULT '02' COMMENT '‘上季度是否采集能耗’标志 ：  01表示已采集 ；02表示未采集',
  `BBI_ADDRESS_JSON` varchar(3000) DEFAULT NULL,
  `BBI_PROUNIT_TEL` varchar(200) DEFAULT NULL COMMENT '产权单位联系人电话',
  `BBI_UPDATE_TIME` datetime DEFAULT NULL,
  PRIMARY KEY (`BBI_ID`),
  KEY `index_bbi_bu_type` (`BBI_BU_TYPE`) USING BTREE,
  KEY `index_bbi_street` (`BBI_STREET`) USING BTREE,
  KEY `index_bbi_domain` (`BBI_BU_DOMAIN`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='¥';

