  `apply_time` datetime DEFAULT NULL COMMENT '预约处理时间',
  `apply_iphone` varchar(100) DEFAULT NULL COMMENT '处理人联系方式',
  PRIMARY KEY (`appoint_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

