  `ar_path` varchar(500) DEFAULT NULL COMMENT '图片路径(逗号隔开)',
  `ar_ispath` varchar(10) DEFAULT NULL COMMENT '文章是否有图片 01：文章  02：图文',
  `ar_firstpath` varchar(500) DEFAULT NULL COMMENT '第一张图片路径',
  `ar_user` varchar(100) DEFAULT NULL COMMENT '作者id',
  `ar_org` varchar(100) DEFAULT NULL COMMENT '作者所属机构',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`ar_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `zly_article` */

insert  into `zly_article`(`ar_id`,`ar_title`,`ar_text`,`ar_type`,`ar_path`,`ar_ispath`,`ar_firstpath`,`ar_user`,`ar_org`,`create_time`,`update_time`) values ('1111','创建国家卫生区知识','创卫工作人人参与  美好环境家家受益\r\n\r\n什么是国家卫生区？\r\n国家卫生区是由全国爱国卫生运动委员会办公室评审并命名的国家级卫生优秀行政区，体现了美好的生活环境和良好的市民素质等内涵，是反映区域经济社会发展水平、文明健康程度的一项重要指标，是全国重要的形象品牌之一。\r\n\r\n为什么要创建国家卫生区？\r\n创建国家卫生区，是贯彻落实党的十九大和习近平总书记系列重要讲话精神、立足首都“四个中心”定位服务首都发展大局、不断推进新时期爱国卫生工作的重要举措，对提升地区环境面貌、改善人民居住环境、提高群众生活质量和健康水平具有十分重要的意义。\r\n朝阳区作为首都的发展大区、承载大区、窗口大区，开展国家卫生区创建活动是建设“健康朝阳”的重要基础和必备条件，也是提升城市品质和群众获得感的重要载体，是朝阳建设和谐宜居模范区的重要抓手。\r\n\r\n创建国家卫生区有哪些意义？\r\n创建国家卫生区，能使基础设施建设得到快速发展，环境卫生质量得到显著改善，生态与居住环境得到不断优化，城市管理与服务能力得到整体提升，居民健康卫生水平得到明显提高，彻底改变城市脏、乱、差的面貌，使朝阳成为天蓝、水碧、地绿，干净、整洁、有序，人与自然和谐统一，社会与经济协调发展，具有可持续发展潜力与实力的健康城区，让老百姓生活得更加安逸、舒心。\r\n\r\n创建国家卫生区包括哪些内容？\r\n1、爱国卫生组织管理\r\n2、健康教育和健康促进\r\n3、市容环境卫生\r\n4、环境保护\r\n5、重点场所卫生\r\n6、食品和生活饮用水安全\r\n7、公共卫生与医疗服务\r\n8、病媒生物预防控制','TZTG','/images/1.jpg','02','/images/1.jpg','0000','紫萝园社区','2020-01-04 15:48:25',NULL),('1112','天气炎热，注意防暑','一、夏天不提倡进行爬山等在室外、白天进行的剧烈活动，建议可选择游泳、早晚慢跑等体育活动。 \r\n二、要多喝白开水，并且要定时饮水，不要等口渴时再喝，口渴后不宜狂饮。应少喝果汁、汽水等饮料，其中含有较多的糖精和电解质，喝多了会对胃肠产生不良刺激，影响消化和食欲。 \r\n三、不宜过量饮酒。人体在夏季受气温影响极易积蕴湿热，而湿热过盛又是诱发皮肤发生疮痈肿毒的病因，若大量饮白酒，更会助热生湿，无异于火上浇油。 \r\n四、饮食不宜过于清淡。夏天人的活动时间长，出汗多，消耗大，应适当多吃鸡、鸭、瘦肉、鱼类、蛋类等营养食品，以满足人体代谢需要。夏天的时令蔬菜，如生菜、黄瓜、西红柿等的含水量较高；新鲜水果，如桃子、杏、西瓜、甜瓜等水分含量为80至90％，都可以用来补充水分。 \r\n五、午睡时间不宜过长。午睡时间过长，中枢神经会加深抑制，脑内血流量相对减少会减慢代谢过程，导致醒来后周身不舒服而更加困倦。 \r\n六、忌受热后“快速冷却”。炎夏，人们外出或劳动归来，喜欢不是开足电扇，就是立即去洗冷水澡，这样会使全身毛孔快速闭合，体内热量反而难以散发，还会因脑部血管迅速收缩而引起大脑供血不足，使人头晕目眩。 \r\n七、空调室内外温差不宜太大。使用空调室内外温差不超过5度为宜，即使天气再热，空调室内温度也不宜到24度以下。 \r\n八、不宜佩戴金属首饰。金属装饰品中的某些金属沾上汗水，所接触到的皮肤可能出现微红或瘙痒等症状，容易引发接触性皮炎。 \r\n九、夏天出门记得要备好防晒用具，最好不要在上午10点至下午4点时在烈日下行走。如果此时必须外出，一定要做好防护工作，如打遮阳伞、戴遮阳帽、戴太阳镜，最好涂抹防晒霜。 \r\n十、生活起居要规律，不经常熬夜，保证充分的睡眠也是预防中暑的有效措施。睡眠时注意不要躺在空调的出风口和电扇下。 \r\n十一、出门还要随身携带防暑降温药品，如十滴水、仁丹、风油精等，以防应急之用。','TZTG',NULL,'01',NULL,'0000','紫萝园社区','2020-01-04 15:48:28',NULL),('1113','2020年独生子女费将打卡发放','根据新政策，户籍在本社区，子女未满18岁，已领取《独生子女父母光荣证》的并且个人存档或失业人员，之前在居委会登记过并领取了2019年下半年独生子女费的(5元/月/人)，请尽快到居委会提交领取人姓名开户的农商银行卡复印件，并需要提交相关材料：1、户口本 2、独生子女证 3、结婚证(离婚证)原件4、身份证5、现场填写《领取独生子女父母奖励费申请表》6、现场填写《个人承诺书》。谢谢配合!\r\n\r\n\r\n办理期限：2019年12月10日------30日\r\n\r\n地点：紫萝园社区服务站(石佛营东里136号院A座108室)\r\n\r\n预约办理联系电话：85840762','SQJS',NULL,'01',NULL,'0000','紫萝园社区','2020-01-04 15:48:34',NULL),('1114','联系我们','紫萝园社区便民服务电话\r\n紫萝园社区居委会    85844892    85846204\r\n紫萝园社区服务站    85840762    85842134\r\n东风派出所             85849101\r\n东风城管                85840857\r\n东风社保所             85848337\r\n中水物业                85817326\r\n紫萝园物业             85835845\r\n万科金阳物业          85818181\r\n东商物业                85811979\r\n燃气公司热线          96777','SQJS',NULL,'01',NULL,'0000','紫萝园社区','2020-01-04 15:48:36',NULL),('1115','社区介绍','紫萝园社区简介\r\n一、紫萝园社区成立于2006年5月，位于东风地区东部，东至京包铁路，西至石佛营路，南至石佛营东里小区中路，北至姚家园路。管辖面积0.22平方公里，现有21栋居民楼和1个平房院，管辖居民3443户。紫萝园社区居委会辖区既有奥士凯副食品公司、粮食局、饮食公司、服装公司、服务公司家属聚集的东商小区，有集体拆迁上楼的农转居人员的东里小区107号楼、109号楼、111号楼，还有教师楼小区，居住的都是东城的优秀教师，更有商住两用年轻人聚集的万科金阳小区，是高档小区与老旧小区相结合的多元化社区。社区共有20个居民小组，47个居民代表。社区党委下设4个党支部，317名党员。社区人口8641人，其中60岁以上老年人约2000余人，占到社区居民的25%，其中空巢、孤寡老人120余人，学龄前儿童约57人，青少年430人，残疾家庭约106户，失独家庭4户，流动人口约2532人。   二、社区工作者情况：目前社区共有社区工作者12人，其中党员11人。2010年设立了社区服务站，进一步明确了以社区党组织为核心、以社区自治组织为基础、以社区服务站为依托，形成了社区党组织、居委会和服务站“三驾马车”；既有明确分工又互相合作的新格局。社区“两委一站”班子健全，社区书记1人、主任1人，社区党委5人制，副书记2名，其中专职党务副书记1人；社区居委会7人制，设副主任1名。社区工作者全部为大专及以上学历，其中考取助理社工师4人。\r\n ','SQJS',NULL,'01',NULL,'0000','紫萝园社区','2020-01-04 15:48:42',NULL),('1116','【宣传】2019年紫萝园社区视屏安全宣传','为进一步普及食品安全知识，广泛动员全社会关心、支持和参与食品安全工作，切实做好食品安全宣传，2019年6月26日，紫萝园社区联合食药所在紫萝园105号院会议室开展食品安全宣传活动及保健食品“五进”科普宣传活动。到会人员40余人。通过宣传，进一步普及保健食品知识，促进居民科学认知保健食品，提升消费者理性消费意识及自我防护意识。此次保健食品进社区的科普宣传受到广大居民一致好评，深表受益匪浅。','SQFC',NULL,'01',NULL,'0000','紫萝园社区','2020-01-04 15:48:44',NULL),('1117','【活动】紫萝园社区党组织服务群众项目 -- 主题观影活动','为了落实党组织服务群众宗旨，纪念新中国成立70周年及建党98周年华诞，强化基层党组织的服务功能，提高新形势下做好服务群众工作的能力，为了集聚党群共建的合力效应，紫萝园社区党委结合“动态楼宇”组织动员居民工作要点，2019年7月4日上午9:00在嘉华影院，组织党群80余人，以“不忘初心”为主题，开展了“赤紫之心”党建系列之主题观影教育活动，旨在弘扬基层党组织的战斗堡垒作用及共产党员的先锋模范作用，坚定党的领导形成合力，有效发挥群建资源，打造党群联动服务队伍。\r\n\r\n此次观看的影片是最新上映的爱国主义题材电影《八子》，它是以中央苏区真实事件改编，讲述了革命先辈浴血奋战、舍生取义的战斗历史，所谓血肉铸山河，英雄永不朽，此次活动让党员群众们重新接受了一场“红色”的精神洗礼。','SQFC',NULL,'01',NULL,'0000','紫萝园社区','2019-11-12 15:48:49',NULL),('1118','【三社一体化】健步走活动','紫萝园社区2019三社一体化项目—— “快乐健步走•绿色健康行”活动，为热爱健康生活，倡导环境保护，拥抱大自然，紫萝园社区开展了“艺”境康健之“快乐健步走•绿色健康行”健步走活动。\r\n\r\n此次活动以协商民主议事组织为主体，社区协助其开展，从而搭建辖区单位与居民的联系平台，居民与居民之间的互动，增加辖区单位与社区居民的幸福感和归属感，释放自己、关爱环保，享受健康生活。活动利用崇尚健康生活，接触大自然这一热门话题，吸引青年群体，倡导放下紧张的工作，脱离健身房高昂的费用，与大自然零接触，灌输既环保又健康的生活理念，从而带动其积极性，旨在动员中青年志愿者。\r\n\r\n2019年7月31日上午8:00在朝阳公园东5门，紫萝园社区联合居民、青少年、党员、和谐促进员、辖区单位和居民议事厅成员志愿者共计60人参与了此次活动。\r\n\r\n在社会组织及居委会的带领下，全体成员迎着朝阳，由朝阳公园东五门准时出发，向健步道行进，参加活动的居民中既有花甲老人，也有中青年人，还有小朋友，他们组成浩浩荡荡的健步行大军如一条长龙，招展着自己制作的队旗，绵延在道路周边，一路上欢声笑语，热闹非凡。为确保活动安全有序的开展，志愿者们分散在队伍中引导和服务，提示大家注意安全。\r\n\r\n活动结束后，居民们纷纷表示此项活动的开展不仅锻炼了身体，还促进了居民间的交流，提高了大家自觉锻炼身体的意识，将吸引更多的人参与到全民健身运动中来。','SQFC',NULL,'01',NULL,'0000','紫萝园社区','2020-01-04 15:48:56',NULL),('2111','办理80岁养老助残卡（即居家养老服务补贴）所需材料','办理80岁养老助残卡（即居家养老服务补贴），周岁生日前提前一个月办理，需要提供以下材料： \r\n\r\n1、老人身份证原件\r\n2、老人户口本原件                                                                                                                                                                                              3、需要本人签字确认          ','LNR','/images/3.jpg','02','/images/3.jpg','0000','紫萝园社区','2020-01-02 18:09:00',NULL),('2112','本市、外埠60-64周岁老年人办理老年证所需材料','本市、外埠 办理老年优待证（60—64周岁） （一）本市老年人业务办理，需要提供以下材料： \r\n1.身份证正、反面复印件1份 \r\n2. 白底彩色1寸照片1张 \r\n\r\n（二）外埠老年人业务办理，需要提供以下材料： \r\n1.暂住证（需在有效期内）第1、2页复印件1份（印在同一张A4纸上） \r\n2. 白底彩色1寸照片1张 \r\n注：年满周岁来京满4个月，周岁生日提前2个月申请\r\n\r\n本市、外埠办理北京通—养老助残卡（65—79周岁10个月） \r\n从2017年1月1日起都去北京农商银行办理。','LNR',NULL,'01',NULL,'0000','紫萝园社区','2020-01-01 18:09:17',NULL),('2113','办理第一个子女及第二个子女《生育服务证》所需材料','一、办理第一个子女及第二个子女《生育服务证》所需材料\r\n\r\n夫妻一方或双方为本市户籍的，可持一下相关内容到本市一方户籍地社区村（居）办理生育登记： \r\n1、夫妻双方：户口本、身份证、结婚证原件。 \r\n2、双方本人填写《生育登记信息采集表》和《生育服务证》第二页内容。如不能来本人来办理的，代办人还需提供《委托书》。 \r\n3、子女已出生申请补办第一个子女《生育服务证》的，需提供包括子女《出生医学证明》原件 \r\n4、办理第二个子女《生育服务证》除以上材料还需要提供，一孩的《独生子女证书》、《准生证》、《出生医学证明》。','JS',NULL,'01',NULL,'0000','紫萝园社区','2020-01-02 18:09:20',NULL),('2114','办理外地来京人员生育服务联系单所需材料','办理外地来京人员生育服务联系单所需材料 \r\n1、男/女方户籍地计划生育部门出具的一年期内的：户籍所在地街乡镇计划生育部门出具婚育状况证明原件或原籍《准生证》一胎准生证须街/乡盖章；二胎准生证须区/县盖章的原件。 \r\n2、享受生育保险人员的社保卡原件。 \r\n3、享受生育保险人员单位开具的一年期内的婚育证明原件 \r\n4、享受生育保险人员和其爱人的暂住证原件。 \r\n5、孩子已出生的需要注明：孩子的“姓名、性别、出生日期”。','JZZ',NULL,'01',NULL,'0000','紫萝园社区','2020-01-03 18:09:23',NULL),('2115','申领第二代《中华人民共和国残疾人证》残疾证办理条件及所需材料','申领第二代《中华人民共和国残疾人证》 \r\n办理条件： \r\n1、户口必须在本社区 \r\n2、提交相关的近一年的病例、X光片 \r\n3、本人或联系人自愿办证 \r\n4、本人（精神、智力、行动特别困难患者除外）或联系人亲自到场申请\r\n\r\n所需材料： 1、户口本首页、本人页、变更页复印件２份                                                                                                                                                                                                                         2、身份证复印件（正反面）３份 \r\n3、二寸蓝底照片 3张 \r\n4、三甲医院的诊断证明书原件及复印件１份（病例及影像资料）','CJR',NULL,'01',NULL,'0000','紫萝园社区','2020-01-10 18:09:26',NULL),('2116',NULL,NULL,NULL,NULL,'01',NULL,'0000','紫萝园社区','2020-01-31 18:09:30',NULL),('2117',NULL,NULL,NULL,NULL,'01',NULL,'0000','紫萝园社区','2020-01-09 18:09:32',NULL),('2118',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);

/*Table structure for table `zly_event` */

DROP TABLE IF EXISTS `zly_event`;

CREATE TABLE `zly_event` (
  `event_id` varchar(100) NOT NULL COMMENT '活动id',
  `event_name` varchar(200) DEFAULT NULL COMMENT '活动名称',
  `event_type` varchar(10) DEFAULT NULL COMMENT '活动分类',
  `event_start` datetime DEFAULT NULL COMMENT '活动开始时间（如果没有结束时间，第二天默认结束）',
  `event_end` datetime DEFAULT NULL COMMENT '活动结束时间',
  `event_local` varchar(200) DEFAULT NULL COMMENT '举办地点',
  `event_limit` int(10) DEFAULT NULL COMMENT '名额',
  `event_real` int(10) DEFAULT NULL COMMENT '实际人数',
  `event_restart` datetime DEFAULT NULL COMMENT '报名开始时间',
  `event_reend` datetime DEFAULT NULL COMMENT '报名截止时间',
  `event_text` text COMMENT '活动介绍',
  `event_status` varchar(10) DEFAULT NULL COMMENT '活动状态  01：进行中 02：已结束',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
